import React, { useState, useEffect } from 'react';
import { ChevronUp } from 'lucide-react';
import { Link } from 'react-router-dom';
import { FaFacebook } from 'react-icons/fa/index.js';
import { FaTwitter } from 'react-icons/fa/index.js';
import { FaLinkedin } from 'react-icons/fa/index.js';
import { FaInstagram } from 'react-icons/fa/index.js';
import { FaTumblr } from 'react-icons/fa/index.js';
import { FaReddit } from 'react-icons/fa/index.js';

const Footer: React.FC = () => {
  const [isVisible, setIsVisible] = useState(false);

  const toggleVisibility = () => {
    if (window.pageYOffset > 300) {
      setIsVisible(true);
    } else {
      setIsVisible(false);
    }
  };

  const scrollToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: 'smooth',
    });
  };

  useEffect(() => {
    window.addEventListener('scroll', toggleVisibility);
    return () => {
      window.removeEventListener('scroll', toggleVisibility);
    };
  }, []);

  return (
    <footer 
      className="bg-[#1a1a1a] text-white py-8 relative" 
      style={{
        background: '#000000',
        backgroundImage: 'linear-gradient(to right, #434343, #000000)'
      }}
    >
      {isVisible && (
        <button
          onClick={scrollToTop}
          className="fixed bottom-4 right-4 text-white p-3 rounded-full transition-all duration-300 z-50"
          aria-label="Scroll to top"
        >
          <ChevronUp size={24} className="text-white" />
        </button>
      )}
      <div className="container mx-auto px-4">
        <div className="grid grid-cols-1 md:grid-cols-4 gap-8">
          {/* Solutions Column */}
          <div>
            <h3 className="text-xl font-bold mb-4">Solution</h3>
            <ul className="space-y-2">
              <li><Link to="/" className="hover:text-gray-300">Enterprise App Development</Link></li>
              <li><Link to="/" className="hover:text-gray-300">Android App Development</Link></li>
              <li><Link to="/" className="hover:text-gray-300">iOS App Development</Link></li>
            </ul>
          </div>

          {/* Industries Column */}
          <div>
            <h3 className="text-xl font-bold mb-4">Industries</h3>
            <ul className="space-y-2">
              <li><Link to="/" className="hover:text-gray-300">Healthcare</Link></li>
              <li><Link to="/" className="hover:text-gray-300">Sports</Link></li>
              <li><Link to="/" className="hover:text-gray-300">E Commerce</Link></li>
              <li><Link to="/" className="hover:text-gray-300">Construction</Link></li>
              <li><Link to="/" className="hover:text-gray-300">Club</Link></li>
            </ul>
          </div>

          {/* Quick Links Column */}
          <div>
            <h3 className="text-xl font-bold mb-4">Quick Links</h3>
            <ul className="space-y-2">
              <li><Link to="/reviews" className="hover:text-gray-300">Reviews</Link></li>
              <li><Link to="/terms" className="hover:text-gray-300">Terms & Condition</Link></li>
              <li><Link to="/disclaimer" className="hover:text-gray-300">Disclaimer</Link></li>
              <li><Link to="/sitemap" className="hover:text-gray-300">Site Map</Link></li>
            </ul>
          </div>

          {/* Stay Connected Column */}
          <div>
            <h3 className="text-xl font-bold mb-4">Stay Connected</h3>
            <div className="mb-4">
              <input 
                type="email" 
                placeholder="Enter Email Address" 
                className="w-full p-2 bg-gray-700 rounded-md"
              />
              <button className="mt-2 bg-blue-600 text-white px-4 py-1 rounded-md hover:bg-blue-700">
                Subscribe
              </button>
            </div>

            <div className="mt-6">
              <h4 className="text-xl font-bold mb-4">Office Location</h4>
              <div className="space-y-4">
                <div>
                  <p className="font-semibold">Los Angeles</p>
                  <p className="text-sm">Office PR 3hr High Tower, New A Ring Road, Los Angeles</p>
                </div>
                <div>
                  <p className="font-semibold">Delhi</p>
                  <p className="text-sm">Office 150B, Behind State Gate Char Bhuja Tower, Station Road, Delhi</p>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Social Media Icons */}
        <div className="mt-8 pt-8 border-t border-gray-600">          <div className="flex space-x-4 justify-center">
            <a href="https://facebook.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-400" aria-label="Facebook"><FaFacebook size={24} /></a>
            <a href="https://twitter.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-400" aria-label="Twitter"><FaTwitter size={24} /></a>
            <a href="https://linkedin.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-400" aria-label="LinkedIn"><FaLinkedin size={24} /></a>
            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-400" aria-label="Instagram"><FaInstagram size={24} /></a>
            <a href="https://tumblr.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-400" aria-label="Tumblr"><FaTumblr size={24} /></a>
            <a href="https://reddit.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-400" aria-label="Reddit"><FaReddit size={24} /></a>
          </div>
        </div>

        {/* Copyright */}
        <div className="mt-8 text-center text-sm">
          <p>Â© All Rights Reserved 2019-{new Date().getFullYear()}</p>
          <p className="mt-2">Designed by DreamIn</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
